INSERT INTO `v1_4a82089e2148299b8ac93e2df3c5c84da05b5e76e53596a0aafb1becadfbae14` VALUES (0.0, 1, "2030/12/17 14:59:59", 4, 10021, 0.0, 4, 110501, 24015, 0.0, "カオリ（サマー）", 24, "あうぅ～残念さ～\nマジムンに魂を\n奪われちゃったかな～？", "2019/07/31 12:00:00");
INSERT INTO `v1_4a82089e2148299b8ac93e2df3c5c84da05b5e76e53596a0aafb1becadfbae14` VALUES (0.0, 2, "2030/12/17 14:59:59", 1, 10021, 4.0, 4, 110501, 24016, 0.0, "カオリ（サマー）", 24, "今日は踊りのキレも悪いよ～\nゴーヤーっぽいもの食べて、元気回復さ～！", "2019/07/31 12:00:00");
INSERT INTO `v1_4a82089e2148299b8ac93e2df3c5c84da05b5e76e53596a0aafb1becadfbae14` VALUES (0.0, 3, "2030/12/17 14:59:59", 4, 10021, 0.0, 4, 110501, 24017, 0.0, "カオリ（サマー）", 24, "マジムンだらけで目が回るさ～！\nふらふらさ～！", "2019/07/31 12:00:00");
INSERT INTO `v1_4a82089e2148299b8ac93e2df3c5c84da05b5e76e53596a0aafb1becadfbae14` VALUES (0.0, 4, "2030/12/17 14:59:59", 2, 10021, 5.2, 1, 110501, 24018, 0.0, "カオリ（サマー）", 24, "なんくるない、なんくるない\n次、頑張ればいいんだよ～！\n海で泳いで\nリフレッシュするさー！", "2019/07/31 12:00:00");
INSERT INTO `v1_4a82089e2148299b8ac93e2df3c5c84da05b5e76e53596a0aafb1becadfbae14` VALUES (0.0, 5, "2030/12/17 14:59:59", 6, 10021, 4.2, 5, 110501, 24019, 0.0, "カオリ（サマー）", 24, "恥ずかしいところ\n見られちゃったね～\n水着？　水着のことじゃないよー？", "2019/07/31 12:00:00");
INSERT INTO `v1_4a82089e2148299b8ac93e2df3c5c84da05b5e76e53596a0aafb1becadfbae14` VALUES (0.0, 6, "2030/12/17 14:59:59", 2, 10021, 0.0, 2, 110501, 24020, 0.0, "カオリ（サマー）", 24, "絶好調さ～！　この調子で\n海の平和を取り戻すよ～！\n楽しい夏が待ってるさ～！", "2019/07/31 12:00:00");
INSERT INTO `v1_4a82089e2148299b8ac93e2df3c5c84da05b5e76e53596a0aafb1becadfbae14` VALUES (0.0, 7, "2030/12/17 14:59:59", 6, 10021, 6.4, 1, 110501, 24021, 0.0, "カオリ（サマー）", 24, "何匹で襲ってきたって\n私はマブイを落っことさないよ～！\nくしゅん！　あ……\n今のくしゃみで落っこちたかも～？", "2019/07/31 12:00:00");
INSERT INTO `v1_4a82089e2148299b8ac93e2df3c5c84da05b5e76e53596a0aafb1becadfbae14` VALUES (0.0, 8, "2030/12/17 14:59:59", 2, 10021, 0.0, 2, 110501, 24022, 0.0, "カオリ（サマー）", 24, "ひーやーさーさー♪\n戦いの後は、踊りを踊って\n気分スッキリさ～！", "2019/07/31 12:00:00");
INSERT INTO `v1_4a82089e2148299b8ac93e2df3c5c84da05b5e76e53596a0aafb1becadfbae14` VALUES (0.0, 9, "2030/12/17 14:59:59", 3, 10021, 10.08, 6, 110501, 24023, 0.0, "カオリ（サマー）", 24, "あれ～？　戦ってるうちに\n水着がどっか行っちゃった～？\nねぇキミ、どっかで見なかった～？\nなんで離れるさ～？", "2019/07/31 12:00:00");
INSERT INTO `v1_4a82089e2148299b8ac93e2df3c5c84da05b5e76e53596a0aafb1becadfbae14` VALUES (0.0, 10, "2030/12/17 14:59:59", 2, 10021, 5.0, 1, 110501, 24024, 0.0, "カオリ（サマー）", 24, "まだまだ私は元気だよ～！\nマジムンでもなんでも、\nどんとこーいさー♪", "2019/07/31 12:00:00");
INSERT INTO `v1_4a82089e2148299b8ac93e2df3c5c84da05b5e76e53596a0aafb1becadfbae14` VALUES (0.0, 11, "2030/12/17 14:59:59", 2, 10021, 0.0, 2, 110501, 24025, 0.0, "カオリ（サマー）", 24, "私の空手は世界最強さ～！\n夏の陽射しと青い海も合わされば、\n向かうところ敵なしだよー！", "2019/07/31 12:00:00");
